import React from "react";
import { Col, Card, Row } from "react-bootstrap";

function Cardie (){
    return(
        <div>
            <Col>
            <Card>
                <h1>apple</h1>
            </Card>
            </Col>
        </div>
    )
}

const Footer = () => {
    return ( 
        <Row style={{background: "black", position: "absolute", paddingTop: "100pt", paddingBottom: "100pt", left:"0" , right:"0"}}>
            <Col>
                <Cardie />  
            </Col>
            <Col>
                <Cardie />  
            </Col>
            <Col>
                <Cardie />  
            </Col>
        </Row>
     );
}

export default Footer;
